- input: "TEXT\x1CC00071365\x1CX0\x1C\x1CF3XA\x1CThis amendment corrects calculations
    for all disbursements on Lines 21(a)(i) and 21(a)(ii).  These totals reflect corrected
    calculations for all disbursements for JJ12 at the allocation ratio of 42% Federal
    and 58% Non-Federal.  The software used by the DSCC of LA did not correct the
    totals when the H2 was revised.  On June 20, 2013 $7317.72 was transferred from
    our Federal Account to our Non-Federal account to correct the miscalculations
    previously reported.  This disbursement will be reported in our July Monthly Report
    2013. During this reporting period the Louisiana Democratic Party did not have
    any salaried employees or persons that provided services to the committee that
    spent more than 25 percent of their time during that period  on activities in
    connection with a Federal election.  Proper timesheets were used to assure the
    25% threshold for not passed.  All disbursements that are reported administrative
    are administrative and are not in connection with a federal candidate or federal
    election.  Salaries paid on the administrative split are for employees who spend
    less than 25% of their work hours on federal election activity. All payments for
    payroll, payroll taxes and insurance that are reported as administrative are not
    paid on behalf of employees who spend more than 25% of their work time on federal
    election activity. Salaries reported on line 21b are for employees who spend less
    than 25% of their work hours on federal election activity.   Please note the Louisiana
    Democratic Party owns it own building and therefore does not make regular rent
    payments        \n"
